import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function AdminForm() {
    const [formData, setFormData] = useState({
        banner: "",
        name: "",
        description: "",
        document1: "",
        document2: "",
        document3: "",
    });

    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Submit the service form to the backend or store locally
        console.log("Service added:", formData);

        // Redirect to services page after submitting
        navigate("/services");
    };

    return (
        <div className="min-h-screen bg-gray-50 p-8">
            <div className="max-w-2xl mx-auto bg-white p-8 rounded-lg shadow-lg">
                <h2 className="text-3xl font-semibold text-gray-800 mb-6">Add a New Service</h2>
                <form onSubmit={handleSubmit}>
                    <div className="space-y-4">
                        <div>
                            <label htmlFor="banner" className="block text-sm font-medium text-gray-700">
                                Service Banner URL
                            </label>
                            <input
                                type="text"
                                name="banner"
                                value={formData.banner}
                                onChange={handleChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                placeholder="Enter service banner URL"
                            />
                        </div>

                        <div>
                            <label htmlFor="name" className="block text-sm font-medium text-gray-700">
                                Service Name
                            </label>
                            <input
                                type="text"
                                name="name"
                                value={formData.name}
                                onChange={handleChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                placeholder="Enter service name"
                            />
                        </div>

                        <div>
                            <label htmlFor="description" className="block text-sm font-medium text-gray-700">
                                Service Description
                            </label>
                            <textarea
                                name="description"
                                value={formData.description}
                                onChange={handleChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                placeholder="Describe the service"
                                rows="4"
                            />
                        </div>

                        <div>
                            <label htmlFor="document1" className="block text-sm font-medium text-gray-700">
                                Document Required 1
                            </label>
                            <input
                                type="text"
                                name="document1"
                                value={formData.document1}
                                onChange={handleChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                placeholder="Enter first required document"
                            />
                        </div>

                        <div>
                            <label htmlFor="document2" className="block text-sm font-medium text-gray-700">
                                Document Required 2
                            </label>
                            <input
                                type="text"
                                name="document2"
                                value={formData.document2}
                                onChange={handleChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                placeholder="Enter second required document"
                            />
                        </div>

                        <div>
                            <label htmlFor="document3" className="block text-sm font-medium text-gray-700">
                                Document Required 3
                            </label>
                            <input
                                type="text"
                                name="document3"
                                value={formData.document3}
                                onChange={handleChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                placeholder="Enter third required document"
                            />
                        </div>
                    </div>

                    <div className="flex justify-between mt-6">
                        <button
                            type="submit"
                            className="bg-blue-600 text-white px-6 py-2 rounded-md hover:bg-blue-700 transition duration-300"
                        >
                            Add Service
                        </button>
                        <button
                            type="button"
                            onClick={() => navigate("/services")}
                            className="bg-gray-600 text-white px-6 py-2 rounded-md hover:bg-gray-700 transition duration-300"
                        >
                            Cancel
                        </button>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default AdminForm;
